DROP TABLE IF EXISTS public.date_dimension;
CREATE TABLE public.date_dimension
(
    date_id serial NOT NULL,
    full_date date NOT NULL,
    year integer GENERATED ALWAYS AS (date_part('year'::text, full_date)) STORED,
    quarter integer GENERATED ALWAYS AS (date_part('quarter'::text, full_date)) STORED,
    month integer GENERATED ALWAYS AS (date_part('month'::text, full_date)) STORED,
    month_name character varying(9) GENERATED ALWAYS AS 
        (extract_month_name(full_date)) STORED,
    day integer GENERATED ALWAYS AS (date_part('day'::text, full_date)) STORED,
    day_name character varying(9) GENERATED ALWAYS AS 
        (extract_day_name(full_date)) STORED,
    CONSTRAINT pk_date NOT NULL (date_id)
);


